require("../../bootstrap/css/bootstrap.min.css"	 )
import "../../bootstrap/js/bootstrap.min.js"
import {tools } from "../../tools.js"

window.onload = function() {
	let $toast = document.createElement("div") 
	$toast.style["position"] ="fixed"
	$toast.style["top"] ="0"
	$toast.style["right"] ="0"
	// $toast.style["transform"] = " translate(-50%, 50%)"
	$toast.innerHTML = `
	 <div class="toast hide" role="alert" id="showqr" data-autohide="false" aria-live="assertive" aria-atomic="true">
              <div class="toast-header">
                <!-- <svg class="bd-placeholder-img rounded mr-2" width="20" height="20" xmlns="http://www.w3.org/2000/svg" preserveAspectRatio="xMidYMid slice" focusable="false" role="img"><rect width="100%" height="100%" fill="#007aff"></rect></svg> -->
                <strong class="mr-auto">Scan Code</strong>
                <!-- <small>11 mins ago</small> -->
                <button type="button" class="ml-2 mb-1 close" data-dismiss="toast" aria-label="Close">
                  <span aria-hidden="true">&times;</span>
                </button>
              </div>
              <div class="toast-body" id="qrcon">
              </div>
            </div>`
            document.body.appendChild($toast)
	let img = document.createElement("img")
	img.style["width"] = "100%"
	img.src = "data:image/png;base64,"
	let addwxbtn = document.querySelectorAll(".js-addwx")
	document.getElementById("qrcon").appendChild(img)
	if(addwxbtn.length > 0) {
		for(let i=0;i<addwxbtn.length;i++) {
			addwxbtn[i].onclick = function(e){
				e.preventDefault()
				$("#showqr").toast("show")
			}
		}
	}
}
